import React from 'react';

const TopPosts = ({ posts }) => (
	<div>
	{posts.map(post => (
		<div>
			<h3><a href="/post/{post.id}">{post.title}</a> by {post.username} (❤️ {post.likes})</h3>
			<p>Created at: {new Date(post.creation_time).toLocaleString()}</p>
		</div>
	))}
	</div>
);

export default TopPosts;
